import ExpenseItem from "./Component/ExpenseItems";

function App() {

  let expenseDate = new Date(2022,7,2);
  let expenseTitle = 'Car Insurance';
  let expenseAmount = 295.35;

  return (
    <div> 
      <ExpenseItem title={expenseTitle} 
        date={expenseDate} 
        amount={expenseAmount}/>
    </div>
  );
}

export default App;
